import { Grid } from "@mui/material";
import React from "react";

const GoodsItem = ({ item }) => {
  const { brand, id, price, product } = item;
  return (
    <Grid item>
      <div className="card">
        <div className="card__body">
            <p></p>
          <h5 className="card__title">{product}</h5>
          <p>{price}</p>
        </div>
      </div>
    </Grid>
  );
};

export default GoodsItem;
